import React, { Component } from 'react';
import './App.css';
import Target from './components/Target'
import Item from './components/Item'
import { Container, Row, Col, Button } from 'reactstrap';
class App extends Component {
  state = {
    Items: [
      {
        id: 0, name: 'Air', url: 'data:image/png;base64,'
      },
      {
        id: 1, name: 'Earth', url: 'data:image/png;base64,'
      },
      {
        id: 2, name: 'Fire', url: 'data:image/png;base64,'
      },
      {
        id: 3, name: 'Water', url: 'data:image/png;base64,'
      },
    ],
    targetArr: [
      {
        id: 0, name: 'Air', url: 'data:image/png;base64,'
      },
      {
        id: 1, name: 'Earth', url: 'data:image/png;base64,'
      },
      {
        id: 2, name: 'Fire', url: 'data:image/png;base64,'
      },
      {
        id: 3, name: 'Water', url: 'data:image/png;base64,'
      },
    ],
    idDrop: 0,
  }

  ChangeItems = idDrag => {
    const { idDrop, targetArr } = this.state;

    if (idDrag === 0 && idDrop === 0) {
      this.setState({
        targetArr: [
          ...targetArr.slice(0, idDrop),
          {
            id: idDrop,
            name: 'Pressure',
            url: 'data:image/png;base64,'
          },
          ...targetArr.slice(idDrop + 1)
        ]
      })
    }

    if ((idDrag === 0 && idDrop === 1) || (idDrag === 1 && idDrop === 0)) {
      this.setState({
        targetArr: [
          ...targetArr.slice(0, idDrop),
          {
            id: idDrop,
            name: 'Dust',
            url: 'data:image/png;base64,'
          },
          ...targetArr.slice(idDrop + 1)
        ]
      })
    }

    if ((idDrag === 0 && idDrop === 2) || (idDrag === 2 && idDrop === 0)) {
      this.setState({
        targetArr: [
          ...targetArr.slice(0, idDrop),
          {
            id: idDrop,
            name: 'Energy',
            url: 'data:image/png;base64,'
          },
          ...targetArr.slice(idDrop + 1)
        ]
      })
    }

    if ((idDrag === 0 && idDrop === 3) || (idDrag === 3 && idDrop === 0)) {
      this.setState({
        targetArr: [
          ...targetArr.slice(0, idDrop),
          {
            id: idDrop,
            name: 'Rain',
            url: 'data:image/png;base64,'
          },
          ...targetArr.slice(idDrop + 1)
        ]
      })
    }

    if (idDrag === 1 && idDrop === 1) {
      this.setState({
        targetArr: [
          ...targetArr.slice(0, idDrop),
          {
            id: idDrop,
            name: 'Pressure',
            url: 'data:image/png;base64,'
          },
          ...targetArr.slice(idDrop + 1)
        ]
      })
    }

    if ((idDrag === 1 && idDrop === 2) || (idDrag === 2 && idDrop === 1)) {
      this.setState({
        targetArr: [
          ...targetArr.slice(0, idDrop),
          {
            id: idDrop,
            name: 'Lava',
            url: 'data:image/png;base64,'
          },
          ...targetArr.slice(idDrop + 1)
        ]
      })
    }

    if ((idDrag === 1 && idDrop === 3) || (idDrag === 3 && idDrop === 1)) {
      this.setState({
        targetArr: [
          ...targetArr.slice(0, idDrop),
          {
            id: idDrop,
            name: 'Mud',
            url: 'data:image/png;base64,'
          },
          ...targetArr.slice(idDrop + 1)
        ]
      })
    }
    if ((idDrag === 2 && idDrop === 3) || (idDrag === 3 && idDrop === 2)) {
      this.setState({
        targetArr: [
          ...targetArr.slice(0, idDrop),
          {
            id: idDrop,
            name: 'Steam',
            url: 'data:image/png;base64,'
          },
          ...targetArr.slice(idDrop + 1)
        ]
      })
    }
    if ((idDrag === 3 && idDrop === 3)) {
      this.setState({
        targetArr: [
          ...targetArr.slice(0, idDrop),
          {
            id: idDrop,
            name: 'Sea',
            url: 'data:image/png;base64,'
          },
          ...targetArr.slice(idDrop + 1)
        ]
      })
    }
    if ((idDrag === 2 && idDrop === 2)) {
      alert('Oops You need to study chemistry again !');
    }
  }

  updateIdDrop = idDrop => {
    this.setState({
      idDrop: idDrop
    })
  }

  reset = () => {
    this.setState({
      targetArr: [
        {
          id: 0, name: 'Air', url: 'data:image/png;base64,'
        },
        {
          id: 1, name: 'Earth', url: 'data:image/png;base64,'
        },
        {
          id: 2, name: 'Fire', url: 'data:image/png;base64,'
        },
        {
          id: 3, name: 'Water', url: 'data:image/png;base64,'
        },
      ],
    })
  }
  render() {
    const { Items, targetArr } = this.state;
    return (
      <div className="App">

        <div className='total-target'>
          <h2>Drop Below Me</h2>

          <div className='drop-Target'>
            <Container id='Container'>
              <Row>
                {
                  targetArr.map((item, index) => (
                    <Col sm="3" key={index}>
                      <Target item={item} key={index} name={item.name} url={item.url} updateIdDrop={(id) => this.updateIdDrop(id)} />
                    </Col>
                  ))
                }

              </Row>
            </Container>

          </div>
          <Button outline color="danger" onClick={() => this.reset()}>
            Study again from the beginning
          </Button>{' '}
        </div>

        <div className="item-container">
          {Items.map((item, index) => (
            <Item item={item} key={index} name={item.name} url={item.url} ChangeItems={(id) => this.ChangeItems(id)} />
          ))}
        </div>

      </div>
    );
  }
}

export default (App);